import React from "react";
import iconCamera from "../../assets/img/icon_camera.svg";

class Modal1 extends React.Component {
  render() {
    return (
      <>
        <div>
          <h3>Step1</h3>
          <div></div>
          <h2>部屋の写真を撮る</h2>
          <p className>飾りたい場所を引き目で撮影してください</p>
          <div>
            <img src={iconCamera} alt="" />
            <p>画像のアップロード</p>
          </div>
        </div>
      </>
    );
  }
}

export default Modal1;
